import React, { Component } from 'react'

export default class Timer extends Component {
  render() {
      var today = new Date();
      const GetTime = () => {

        var time = today.getHours() + ":" + today.getMinutes() + ":" + today.getSeconds();
      }
      time = setInterval(GetTime, 1000);
    return (
      <div className="timer">
        {time} Hello World
      </div>
    )
  }
}
